function review(name_array, name_review){
	var new_review = Math.floor(Math.random() * name_array.length);
	document.getElementById(name_review).src = name_array[new_review];
}

function quiz(name_array, name_review){
	var new_review = Math.floor(Math.random() * name_array.length);
	document.getElementById('quiz_img').src = name_array[new_review];
	if (name_array.length == 0){
		name_array.concat(done);
		document.getElementById('quiz_img').src = "http://www.a-49.co.uk/images/pass.jpg";
	}
	name_array.splice(new_review, 1);
	done.push(name_array[new_review]);
}

